import React from 'react'
import ExpenseDate from './ExpenseDate'
import './Expense.css'
import Card from './UI/Card'
const Expense = (props) => {
    console.log('INI PROPS',props.item)
    const {
        date
    } = props.item
    return (
        <Card>
            <div>
                <ExpenseDate expenseDate={date}/>    
            </div>
        </Card>
    )
}

export default Expense
